NTSTATUS saveHiveToFile(PUNICODE_STRING pBackupDir, PUNICODE_STRING pRegHive) {
	BOOLEAN backupOldState, restoreOldState;
	NTSTATUS status = STATUS_UNDEFINED_SCOPE;
	HANDLE hBackupFile = INVALID_HANDLE_VALUE;
	HANDLE hRegHive = INVALID_HANDLE_VALUE;
	USHORT lineNum = 0;
	IO_STATUS_BLOCK ioSb;
	OBJECT_ATTRIBUTES fileAttr, hiveAttr;
	InitializeObjectAttributes(&fileAttr, pBackupDir, OBJ_CASE_INSENSITIVE, NULL, NULL);
	InitializeObjectAttributes(&hiveAttr, pRegHive, OBJ_CASE_INSENSITIVE, NULL, NULL);

	do {
		if (!pBackupDir || !pRegHive) {
			status = STATUS_INVALID_PARAMETER;
			break;
		}
		//myWPrintf(&lineNum, L"Filepath: %ws", fileAttr.ObjectName->Buffer);
		status = RtlAdjustPrivilege(SE_BACKUP_PRIVILEGE, TRUE, FALSE, &backupOldState);
		if (status)
			break;

		status = RtlAdjustPrivilege(SE_RESTORE_PRIVILEGE, TRUE, FALSE, &restoreOldState);
		if (status)
			break;
		//pBackupDir->Buffer[pBackupDir->Length / sizeof(WCHAR) - 2] = L'.';
		//WCHAR bleh[] = L"BackupDir: %wZ||||";
		//myWPrintf(&lineNum, bleh, pBackupDir);
		status = NtCreateFile(&hBackupFile, GENERIC_ALL | SYNCHRONIZE, &fileAttr, &ioSb, NULL, FILE_ATTRIBUTE_SYSTEM, 0, FILE_SUPERSEDE, FILE_NON_DIRECTORY_FILE | FILE_SYNCHRONOUS_IO_NONALERT, NULL, 0);
		if (status) {
			hBackupFile = NULL;
			break;
		}

		status = NtOpenKeyEx(&hRegHive, KEY_READ, &hiveAttr, REG_OPTION_BACKUP_RESTORE);
		if (status) {
			hRegHive = NULL;
			break;
		}

		status = NtSaveKeyEx(hRegHive, hBackupFile, REG_LATEST_FORMAT);
		if (status)
			break;
	} while (status);

	RtlAdjustPrivilege(SE_BACKUP_PRIVILEGE, backupOldState, FALSE, &backupOldState);
	RtlAdjustPrivilege(SE_RESTORE_PRIVILEGE, backupOldState, FALSE, &restoreOldState);

	if (hRegHive)
		NtClose(hRegHive);

	if (hBackupFile)
		NtClose(hBackupFile);

	return status;
}

